import Vue from 'vue';
import VueRouter from 'vue-router';  // Correct import statement
import WasteList from '../components/WasteList.vue';
import WasteForm from '../components/WasteForm.vue';

Vue.use(VueRouter);  // Install the router plugin

const routes = [
    {
        path: '/',
        name: 'WasteList',
        component: WasteList
    },
    {
        path: '/waste/add',
        name: 'AddWaste',
        component: WasteForm
    },
    {
        path: '/waste/edit/:id',
        name: 'EditWaste',
        component: WasteForm,
        props: true
    }
];

const router = new VueRouter({
    mode: 'history',
    routes
});

export default router;
